    <title>Are you 21 or older?</title>
    <script src="https://ajax.googleapis.com/ajax/libs/jquery/3.7.1/jquery.min.js"></script>
    <style>
        body {
            background-color: #FFFFFF;
            margin: 0;
            padding: 0;
            height: 100%;
            font-family: Arial, Helvetica, sans-serif;
            font-size: 30px;
            direction: inherit;
            text-align: inherit;
        }

        .wrapper>header {
            border-bottom: 1px solid transparent;
            margin-bottom: 15px;
        }

        #main {
            position: relative;
            max-width: 100%;
            padding: 0 1em 3em;
            background: transparent;
            border-radius: 4px;
            cursor: default;
            text-align: center;
        }

        .box .box-header {
            margin: 25px auto;
            max-width: 360px;
        }

        .align-btn {
            display: flex;
            justify-content: center;
            flex-direction: row;
        }

        html[dir="rtl"] #yes-btn {
            order: 2;
        }

        html[dir="rtl"] #no-btn {
            order: 1;
        }

        .btn {
            min-width: 125px;
            min-height: 50px;
            text-transform: uppercase;
            letter-spacing: 1.3px;
            transition: all 0.3s ease-in-out 0s;
            cursor: pointer;
            outline: none;
            position: relative;
            padding: 10px;
            background-color: #ACEC3E;
            background-image: linear-gradient(#ACEC3E, #58BD23);
            color: #FFFFFF;
            border: 1px solid #58BD23;
            border-radius: 10px;
            font-size: 20px;
            font-weight: 900;
        }

        .wrap {
            padding: 7px;
        }

        p,
        ul,
        li,
        ol,
        h1,
        h2,
        h3,
        h4,
        h5 {
            margin: 0;
            padding: 0;
            list-style: none;
            font-weight: normal;
        }

        .hide {
            display: none;
        }

        .btn-shadow {
            box-shadow: 0px 3px 5px rgba(0, 0, 0, 0.2);
        }

        @keyframes glowing {

            0%,
            100% {
                background-color: #ACEC3E;
                box-shadow: 0 0 3px #ACEC3E, 0px 3px 5px rgba(0, 0, 0, 0.2);
            }

            50% {
                background-color: #75E53D;
                box-shadow: 0 0 10px #75E53D, 0px 3px 5px rgba(0, 0, 0, 0.2);
            }
        }

        .bL1 {
            animation: glowing 750ms infinite;
        }

        @media (max-width: 420px) {
            .wrapper>header {
                border-bottom-width: 3px;
            }
        }
    </style>
</head>
